function selectorListener(){let e=document.getElementById("grados").value;switch(e){case"cuarto":buildData(URLcuarto);break;case"quinto":buildData(URLquinto);break;case"sexto":buildData(URLsexto)}}function buildData(e){var t=[];fetch(e).then(function(e){return e.json()}).then(e=>{t=e.values,buildTable(t,"avisos-academicos")})}function buildTable(e,t){clearTable("avisos-academicos");let a="#"+t+">tbody",o=document.querySelector(a);if(null==e){let e=document.createElement("tr");e.textContent="no hay avisos para mostrar",o.append(e)}else for(i=0;i<e.length;i++){let t=document.createElement("tr");for(o.append(t),j=0;j<e[i].length;j++){let a=document.createElement("td");a.textContent=e[i][j],t.append(a)}}}function clearTable(e){let t="#"+e+">tbody",a=document.querySelector(t);a.innerHTML=""}const URLcuarto="https://sheets.googleapis.com/v4/spreadsheets/1ZX90uRbL2zQcVfPiMp_Y3K-WI0BxQPooSgr00QLPS_g/values/academicos!A3:F?key=AIzaSyDzdEQYUcSwjzEmZNZhYd2vh1E_P6ykPAY",URLquinto="https://sheets.googleapis.com/v4/spreadsheets/1ZX90uRbL2zQcVfPiMp_Y3K-WI0BxQPooSgr00QLPS_g/values/academicos!G3:L?key=AIzaSyDzdEQYUcSwjzEmZNZhYd2vh1E_P6ykPAY",URLsexto="https://sheets.googleapis.com/v4/spreadsheets/1ZX90uRbL2zQcVfPiMp_Y3K-WI0BxQPooSgr00QLPS_g/values/academicos!M3:S?key=AIzaSyDzdEQYUcSwjzEmZNZhYd2vh1E_P6ykPAY";